import React from "react";
import { useNavigate } from "react-router-dom";

export default function CoupleHome() {
  const navigate = useNavigate();

  const services = [
    { name: "Venue", icon: "/icons/venue.png" },
    { name: "Catering", icon: "/icons/catering.png" },
    { name: "Photography", icon: "/icons/photography.png" },
    { name: "Beauty & Wellness", icon: "/icons/beauty.png" },
    { name: "Designer", icon: "/icons/designer.png" },
    { name: "Jewelry", icon: "/icons/jewellery.png" },
    { name: "Car Dealers", icon: "/icons/car.png" },
    { name: "Events", icon: "/icons/event.png" },
  ];

  return (
    <div className="min-h-screen bg-pink-100">
      {/* Header */}
      <header className="bg-orange-300 p-4 flex justify-between items-center shadow-lg">
        <h1 className="text-3xl font-bold flex items-center">
          <img src="/logo.png" alt="WedNest Logo" className="h-12 w-auto mr-3" />
          WedNest
        </h1>
        <div className="flex gap-6">
          <button className="text-lg" onClick={() => navigate("/")}>Home</button>
          <button className="text-lg" onClick={() => navigate("/settings")}>Settings</button>
          <span className="text-lg">ðŸ›’</span>
          <span className="text-lg">ðŸ‘¤</span>
        </div>
      </header>

      

      

      {/* Services Section */}
      <section className="p-10">
        <h2 className="text-2xl font-bold text-center mb-6">SERVICES</h2>
        <div className="grid grid-cols-2 md:grid-cols-4 gap-8 place-items-center">
          {services.map((service, index) => (
            <div key={index} className="text-center">
              <img src={service.icon} alt={service.name} className="w-20 h-20 mx-auto mb-2" />
              <p className="text-lg font-semibold">{service.name}</p>
            </div>
          ))}
        </div>
      </section>
    </div>
  );
}
